import { BrowserRouter, Routes, Route } from "react-router-dom";
import Landing from "./Components/Landing/Landing";
// import Applicant from "./Components/Applicant/Applicant";
// import Organization from "./Components/Orginazation/Organization";
import SideNav from "./Components/Admin/SideNav";
import Nav from "./Components/Admin/Nav";
import Users from "./Components/Admin/Users";
import Certification from "./Components/Admin/Certification";
import AddTask from "./Components/Admin/AddTask";
import AddPost from "./Components/Admin/AddPost";
import ViewTask from "./Components/Applicant/ViewTask";
import Main from "./Components/Applicant/Main";
function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={< SideNav/>} /> 
      <Route index element={<SideNav/>} />

     <Route path="hellow" element={<Nav/>}>
        <Route index element={< Users/>} /> 
        <Route path="Certification" element={< Certification/>} /> 
        <Route path="AddTask" element={< AddTask/>} /> 
        <Route path="Post" element={< AddPost/>} /> 


     </Route>
     <Route path="Applicant" element={<Main/>}>
     <Route index element={<Main/>} /> 
     <Route path="ViewTask" element={< ViewTask/>} /> 
     </Route>

      {/* <Route path="/applicant" element={< Applicant/>} />  */}
      {/* <Route path="/organization" element={< Organization/>} />  */}



    </Routes>
  </BrowserRouter>

  );
}

export default App;
